{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/andrewgryson/bellabeat-case-study?scriptVersionId=147371728\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"# ***Bellabeat Case Study***","metadata":{}},{"cell_type":"markdown","source":"![](https://www.blue365deals.com/sites/default/files/styles/994x560_flex_2x/public/images/vendor/bellabeat_brand_logo_blue.png?itok=uenOa2rM)","metadata":{}},{"cell_type":"markdown","source":"## Table of Contents\n* [Introduction](#introduction)\n* [1. Ask:](#1.0)\n    * [1.1 Business Task](#1.1)\n    * [1.2 Stakeholders](#1.2)\n* [2. Prepare:](#2.0)\n    * [2.1 Dataset](#2.1)\n    * [2.2 Licensing, Privacy and Accessibility of Data](#2.2)\n    * [2.3 Dataset Information](#2.3)\n    * [2.4 Data Organization](#2.4)\n    * [2.5 Data Integrity](#2.5)\n* [3. Process:](#3.0)\n    * [3.1 Tools](#3.1)\n    * [3.2 Data Cleaning in Google Sheets](#3.2)\n    * [3.3 Data Cleaning and Verification in SQL](#3.3)\n    * [3.4 Data Verification in R](#3.4)\n* [4. Analysis:](#4.0)\n    * [4.1 What time of day are users most active?](#4.1)\n    * [4.2 What days are users most active?](#4.2)\n    * [4.3 Does walking more lead to more sleep?](#4.3)\n    * [4.4 Does less sedentary time lead to more sleep?](#4.4)\n    * [4.5 Does more time in bed lead to more sleep?](#4.5)\n    * [4.6 Do more steps lead to more calories burned?](#4.6)\n* [5. Share:](#5.0)\n    * [5.1 Times Users Are Most Active Visualization](#5.1)\n    * [5.2 Days Users Are Most Active Visualization](#5.2)\n    * [5.3 Total Steps vs Total Minutes Asleep Visualization](#5.3)\n    * [5.4 Total Sedentary Minutes vs Total Minutes Asleep Visualization](#5.4)\n    * [5.5 Total Time In Bed vs Total Minutes Asleep Visualization](#5.5)\n    * [5.6 Total Steps vs Total Calories Burned Visualization](#5.6)\n* [6. Act:](#6.0)\n    * [6.1 Conclusion](#6.1)\n    * [6.2 Next Steps - Recommendations](#6.2)\n    * [6.3 Appendix](#6.3)","metadata":{}},{"cell_type":"markdown","source":"# Introduction <a class=\"anchor\"  id=\"introduction\"></a>\n\nBellabeat is a high-tech company that manufactures health-focused smart products that empower women with knowledge about their health and habits. They are a small, but rapidly growing company and they have the potential to become a larger player in the global smart device market. \n\nThe main focus is to analyze smart device usage data in order to gain insight into how consumers use non-Bellabeat smart devices and apply these insights to one of Bellabeat's products. These insights will help inform Bellabeat's marketing strategy to expand its footprint in the industry. \n\nWe will focus on the Bellabeat app for this analysis. The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products so it is at the core of everything they're trying to help their consumers accomplish.","metadata":{"_uuid":"8f2839f25d086af736a60e9eeb907d3b93b6e0e5","_cell_guid":"b1076dfc-b9ad-4769-8c92-a6c4dae69d19"}},{"cell_type":"markdown","source":"# 1. Ask: <a class=\"anchor\"  id=\"1.0\"></a>\n\n### 1.1 Business Task <a class=\"anchor\"  id=\"1.1\"></a>\nBellabeat wants to grow its footprint within the industry. I will be analyzing smart device usage in a competitor in order to identify trends to be applied to Bellabeat’s growth marketing strategy. \n\n### 1.2 Stakeholders <a class=\"anchor\"  id=\"1.2\"></a>\nUrška Sršen (CCO/founder), Sando Mur (co-founder), Belleabeat's executive team, and Bellabeat's marketing team.","metadata":{}},{"cell_type":"markdown","source":"# 2. Prepare: <a class=\"anchor\"  id=\"2.0\"></a>\n### 2.1 Dataset <a class=\"anchor\"  id=\"2.1\"></a>\nThe data source used is the FitBit Fitness Tracker Data stored in Kaggle and made available through Mobius. I downloaded the dataset and saved it to my local drive.\n### 2.2 Licensing, Privacy and Accessibility of Data <a class=\"anchor\"  id=\"2.2\"></a>\nA quick overview of the metadata verifies that this data is open-source. The author has reliquished his or her rights under copywrite law. This means we can copy, modify, distribute and perform work on it without the need to gain permission. \n### 2.3 Dataset Information <a class=\"anchor\"  id=\"2.3\"></a>\nThis dataset was generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. FitBit users consented to the submission of personal tracker data. This included minute-level output for physical activity, heart rate, and sleep monitoring. It also includes information about daily activity, steps, and heart rate that can be used to explore users’ habits.  \n\nThis data will be instrumental in pinpointing areas of underutilized smart device fitness features, presenting opportunities to bridge the gap with competitors and leverage their overlooked areas. Armed with this knowledge, Bellabeat can strategically introduce new features and target previously untapped benefits, thereby broadening its market presence.\n### 2.4 Data Organization <a class=\"anchor\"  id=\"2.4\"></a>\nThere are 18 CSV files. Each contain different quantitative data captured on FitBit users. Each user has a unique ID. The data is in long format. Each user has multiple rows of data and each row represents a different time/date that the data was documented. I created Pivot Tables in Google Sheets to get an overview of the data in each table. I counted the sample size and verified the length of time the data was collected in each.\n### 2.5 Data Integrity <a class=\"anchor\"  id=\"2.5\"></a>\nThe data is reliable, however, it is a rather small sample size. We also do not have the demographics of the users within the data. It may not be wholly representative of the population. These factors could result in bias within the data. ","metadata":{}},{"cell_type":"markdown","source":"# 3. Process: <a class=\"anchor\"  id=\"3.0\"></a>\n### 3.1 Tools <a class=\"anchor\"  id=\"3.1\"></a>\nI'm choosing to use Google Sheets, SQL, Tableau and R because I want to practice and showcase my skills in each of these tools. \n### 3.2 Data Cleaning in Google Sheets <a class=\"anchor\"  id=\"3.2\"></a>\n* I created Pivot Tables to get an overview of the data in each table. I counted the sample size and verified the length of time the data was collected.\n* Since we’re looking for high-level recommendations, I focused solely on the daily tables with the exception of the hourly steps. Outside of knowing which hours of the day the users are most active, it isn’t necessary to get into the minutia of the users’ data by the hour and minute. \n* The Weight data only had a sample size of 8 users so that table is too limited for analysis. \n* The Daily Activity, Calories, Intensities, Steps, and Hourly Steps all had full participation(33 users) for 31 days. Also, the Daily Sleep table was close to full participation with 24 users. So I will conduct a deeper analysis of each of these.  \n* Corrected the date/time formatting to ‘dd/mm/yyyy’ in all the tables except the Hourly Steps. In the Hourly Steps table, I formatted the date/time to the standard ‘dd/mm/yyyy hh:mm:ss’ and then use the Split function to create separate ActivityDay and ActivityHour columns. \n* Then I added an additional column, called Weekday, to each table except HourlySteps. Here I converted the dates into the text names for each day of the week.\n* Standardized the number formatting across all tables to two decimal places.\n* Used conditional formatting to check for NULL data. There was none. \n* Trimmed the whitespace within the data. \n* Checked for and removed erroneous duplicates within the data. \n\npivot_table_counts | number_of_days | number_of_ids \n------------------ | -------------- | -------------\ndaily_activity | 31 | 33 \ndaily_calories | 31 | 33 \ndaily_intensities | 31 | 33 \ndaily_sleep | 31 | 24\ndaily_steps | 31 | 33 \nhourly_steps | 31 | 33\n\n### 3.3 Data Cleaning and Verification in SQL <a class=\"anchor\"  id=\"3.3\"></a>\n* In BigQuery, I created a new Dataset for the FitBit data within my data project practice workspace. I uploaded the Daily Activity, Calories, Intensities, Steps and Sleep tables.\n* I verified the data and data type were accurate within the Schema and Preview of each table. \n* I performed another verification that the data mapped over correctly by running the code below in BigQuery to check the number of unique users and days recorded in each table. \n* All of the results match our original data and Pivot Tables from Google Sheets. \n\n","metadata":{}},{"cell_type":"code","source":"#daily_activity count\n\nSELECT\n  \t  COUNT(DISTINCT ActivityDate) AS number_of_days,\n      COUNT(DISTINCT Id) AS number_of_ids\nFROM \n  my-data-project-12345-391023.fitbit_data.daily_activity AS daily_activity\n\n#Result: number_of_days = 31 & number_of_ids = 33","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#daily_calories count\n\nSELECT\n  \t  COUNT(DISTINCT ActivityDay) AS number_of_days,\n      COUNT(DISTINCT Id) AS number_of_ids\nFROM \n  my-data-project-12345-391023.fitbit_data.daily_calories AS daily_calories\n\n#Result: number_of_days = 31 & number_of_ids = 33","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#daily_intensities count\n\nSELECT\n  \t  COUNT(DISTINCT ActivityDay) AS number_of_days,\n      COUNT(DISTINCT Id) AS number_of_ids\nFROM \n  my-data-project-12345-391023.fitbit_data.daily_intensities AS daily_intensities\n\n#Result: number_of_days = 31 & number_of_ids = 33","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#daily_sleep count\n\nSELECT\n  \t  COUNT(DISTINCT SleepDay) AS number_of_days,\n      COUNT(DISTINCT Id) AS number_of_ids\nFROM \n  my-data-project-12345-391023.fitbit_data.daily_sleep AS daily_sleep\n    \n#Result: number_of_days = 31 & number_of_ids = 24","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#daily_steps count\n\nSELECT\n  \t  COUNT(DISTINCT ActivityDay) AS number_of_days,\n      COUNT(DISTINCT Id) AS number_of_ids\nFROM \n  my-data-project-12345-391023.fitbit_data.daily_steps AS daily_steps\n    \n#Result: number_of_days = 31 & number_of_ids = 33","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#hourly_steps count\n\nSELECT\n  \t  COUNT(DISTINCT ActivityDay) AS number_of_days,\n      COUNT(DISTINCT Id) AS number_of_ids\nFROM \n  my-data-project-12345-391023.fitbit_data.hourly_steps AS hourly_steps\n    \n#Result: number_of_days = 31 & number_of_ids = 33","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"### 3.4 Data Verification in R <a class=\"anchor\"  id=\"3.4\"></a>\n* I performed one final verification to confirm there are no missing values in the cleaned datasets.\n* First, I installed the packages I needed and opened them. \n* Then I uploaded the datasets.","metadata":{}},{"cell_type":"code","source":"install.packages(\"ggplot2\")\nlibrary(ggplot2)\nlibrary(readr)","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"dailyActivity <- read.csv(\"dailyActivity_merged - dailyActivity_merged.csv.csv\")\ndailyCalories <- read.csv(\"dailyCalories_merged - dailyCalories_merged.csv.csv\")\ndailyIntensities <- read.csv(\"dailyIntensities_merged - dailyIntensities_merged.csv.csv\")\ndailySteps <- read.csv(\"dailySteps_merged - dailySteps_merged.csv.csv\")\nhourlySteps <- read.csv(\"hourlySteps_merged - hourlySteps_merged.csv.csv\")\nsleepDay <- read.csv(\"sleepDay_merged - sleepDay_merged.csv.csv\")","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"* Next, I checked for missing values in each dataset with the bit of code below.\n* This resulted in a total of zero missing values from our tables. \n* We can now proceed to the analysis with confidence knowing our data is clean and verified. ","metadata":{}},{"cell_type":"code","source":"#dailyActivity missing values\n\nsum(is.na(dailyActivity))\n\n#Result: [1] 0","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#dailyCalories missing values\n\nsum(is.na(dailyCalories))\n\n#Result: [1] 0","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#dailyIntensities missing values\n\nsum(is.na(dailyIntensities))\n\n#Result: [1] 0","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#dailySteps missing values\n\nsum(is.na(dailySteps))\n\n#Result: [1] 0","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#hourlySteps missing values\n\nsum(is.na(hourlySteps))\n\n#Result: [1] 0","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#sleepDay missing values\n\nsum(is.na(sleepDay))\n\n#Result: [1] 0","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# 4. Analysis: <a class=\"anchor\"  id=\"4.0\"></a>\n### 4.1 What time of day are users most active? <a class=\"anchor\"  id=\"4.1\"></a>\n* I used the hourly_steps table to analyze when the users are most active. \n* I have already split the time into separate days and hours columns within Google Sheets before I uploaded this table to BigQuery.\n* Now I can calculate the SUM of total steps for each hour and order them from greatest to least. \n","metadata":{}},{"cell_type":"code","source":"SELECT  \n  ActivityHour,\n  SUM(StepTotal) AS Sum_StepTotal,\n  AVG(StepTotal) AS Avg_StepTotal\nFROM \n  `my-data-project-12345-391023.fitbit_data.hourly_steps`\nGROUP BY\n  ActivityHour\nORDER BY\n  Sum_StepTotal DESC","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![time_users_are_most_active.png](attachment:2e1b56f9-4636-4222-a306-26bdab841a2a.png)\n\n* Unsurprisingly, the most steps are taken by our users at 18:00 and 19:00. Just after they get off work. That's usually when most people get their workouts in.\n* Followed closely behind those are 12:00, 17:00, 14:00, and 13:00 respectively. Again this makes sense as most people get the majority of their steps in during the day especially on the weekends. \n* The average total steps align with the sums as well. \n* It'll be interesting to see how the step counts are distributed by day.\n* I am a little surprised to not see more high activity levels in the morning. The highest morning step count is all the way down in the 8th spot. \n* There are several additional benefits to working out in the morning. This could provide an opportunity for Bellabeat to motivate their users to get moving earlier rather than later.\n* I saved this as a table in Big_Query. I will be visualizing this later on in the Share portion of this project. Stay tuned.","metadata":{},"attachments":{"2e1b56f9-4636-4222-a306-26bdab841a2a.png":{"image/png":""}}},{"cell_type":"markdown","source":"### 4.2 What days are users most active? <a class=\"anchor\"  id=\"4.2\"></a>\n* I used the daily_steps table to analyze which days the users are most active.\n* I have already converted the days of the week into their own column in Google Sheets.\n* Now I can calculate the SUM and AVG of the daily steps. \n","metadata":{}},{"cell_type":"code","source":"SELECT  \n  Weekday,\n  SUM(StepTotal) AS Sum_StepTotal,\n  AVG(StepTotal) AS Avg_StepTotal\nFROM \n  `my-data-project-12345-391023.fitbit_data.daily_steps`\nGROUP BY\n  Weekday\nORDER BY\n  Sum_StepTotal DESC","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![days_users_are_most_active.png](attachment:25582577-2cc4-42fc-a521-6d6b6647d215.png)\n* Saturday has the highest average amount of steps, but that doesn't tell the whole story. \n* Tuesday, Wednesday and Thursday actually had a higher total sum of steps. \n* So it looks like Tuesday-Thursday are the most active days. However, users tend to walk further on Saturdays when they do get steps in. \n* This feels like a great opportunity to target users' less active days(Sunday, Monday, Friday) and send them reminders/inspiration/motivation notifications to get active. Consistency is key in health and fitness. \n* More on this later in the Share portion. ","metadata":{},"attachments":{"25582577-2cc4-42fc-a521-6d6b6647d215.png":{"image/png":""}}},{"cell_type":"markdown","source":"### 4.3 Does walking more lead to more sleep? <a class=\"anchor\"  id=\"4.3\"></a>\n* I used the daily_activity and daily_sleep tables to analyze whether more steps would lead to more sleep.\n* By creating a temporary table and using an INNER JOIN, I was able to compare and contrast the sum of users total steps with the sum of their total minutes asleep.","metadata":{}},{"cell_type":"code","source":"WITH temp_table AS (\nSELECT \n  Id,\n  SUM(TotalSteps) AS Sum_TotalSteps\nFROM\n  `my-data-project-12345-391023.fitbit_data.daily_activity`\nGROUP BY\n  Id\nORDER BY\n  Sum_TotalSteps DESC\n)\nSELECT \n  temp_table.Id,\n  temp_table.Sum_TotalSteps,\n  SUM(TotalMinutesAsleep) AS Sum_TotalMinutesAsleep\nFROM\n  temp_table\nINNER JOIN\n  `my-data-project-12345-391023.fitbit_data.daily_sleep` AS daily_sleep\nON\n  daily_sleep.Id = temp_table.Id\nGROUP BY\n  temp_table.Id,\n  temp_table.Sum_TotalSteps\nORDER BY\n  temp_table.Sum_TotalSteps DESC","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![totalsteps_x_totalminutesasleep.png](attachment:923aedbf-e0bd-492d-8b79-5f59d87d68a3.png)\n\n* Surprisingly, I saw no correlation between the two. It'll be interesting to see if a visualization better shows a relationship between the two. See the Share phase for more on this. \n* This made me curious if other factors possibly have an effect on sleep since it doesn't look like total steps does. So I looked into a few other comparisons. ","metadata":{},"attachments":{"923aedbf-e0bd-492d-8b79-5f59d87d68a3.png":{"image/png":""}}},{"cell_type":"markdown","source":"### 4.4 Does less sedentary time lead to more sleep? <a class=\"anchor\"  id=\"4.4\"></a>\n* I used the daily_activity and daily_sleep tables again to analyze if less sedentary time would lead to more sleep.\n* By creating a temporary table and using an INNER JOIN, I was able to compare and contrast the sum of users total sedentary time with the sum of their total minutes asleep.","metadata":{}},{"cell_type":"code","source":"WITH temp_table AS (\nSELECT \n  Id,\n  SUM(SedentaryMinutes) AS Sum_SedentaryMinutes\nFROM\n  `my-data-project-12345-391023.fitbit_data.daily_activity`\nGROUP BY\n  Id\nORDER BY\n  Sum_SedentaryMinutes DESC\n)\nSELECT \n  temp_table.Id,\n  temp_table.Sum_SedentaryMinutes,\n  SUM(TotalMinutesAsleep) AS Sum_TotalMinutesAsleep\nFROM\n  temp_table\nINNER JOIN\n  `my-data-project-12345-391023.fitbit_data.daily_sleep` AS daily_sleep\nON\n  daily_sleep.Id = temp_table.Id\nGROUP BY\n  temp_table.Id,\n  temp_table.Sum_SedentaryMinutes\nORDER BY\n  temp_table.Sum_SedentaryMinutes ASC ","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![totalsedentaryminutes_x_totalminutesasleep.png](attachment:bfa6f77f-9db6-4c2b-a0b9-ed0454dc3d3f.png)\n\n* It looks like there is a negative correlation between total sedentary minutes and total minutes asleep. Which means as sedentary minutes decline total minutes asleep increases. \n* So it's not total steps that are related to better sleep. It's actually just the less time you're inactive then the more sleep you get. \n* This provides another good opportunity for some motivation/reminder notifications. \n* If a user wants to get more sleep, we can focus more on their amount of time active rather than their total number of steps. \n* As the data shows, the less sedentary time a person experiences throughout their day the more sleep they will gain at night. ","metadata":{},"attachments":{"bfa6f77f-9db6-4c2b-a0b9-ed0454dc3d3f.png":{"image/png":""}}},{"cell_type":"markdown","source":"### 4.5 Does more time in bed lead to more sleep? <a class=\"anchor\"  id=\"4.5\"></a>\n* I used the daily_sleep table to analyze if more time in bed would lead to more minutes of sleep.\n* I used a DISTINCT query to calculate the sum of the total minutes asleep and the total time in bed for each specific user.\n* When comparing the two, there looks to be a positive correlation between amount of time in bed and the total minutes asleep.\n* There are some outliers, but I think the visualization will show clearly the positive correlation. More on that to come.\n* So the more time our users spend in bed, the more sleep they get. \n* This could be a great opportunity to implement a notification within the app to remind users to go to sleep in order to get the recommended amount. ","metadata":{}},{"cell_type":"code","source":"SELECT \n  Id,\n  SUM(TotalMinutesAsleep) AS Sum_TotalMinutesAsleep,\n  SUM(TotalTimeInBed) AS Sum_TotalTimeInBed\nFROM\n  `my-data-project-12345-391023.fitbit_data.daily_sleep`\nGROUP BY\n  Id\nORDER BY\n  Sum_TotalTimeInBed DESC","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![totaltimeinbed_x_totaltimeasleep.png](attachment:f68e972b-dac2-4429-98cb-1db01602bb1b.png)","metadata":{},"attachments":{"f68e972b-dac2-4429-98cb-1db01602bb1b.png":{"image/png":""}}},{"cell_type":"markdown","source":"### 4.6 Do more steps lead to more calories burned? <a class=\"anchor\"  id=\"4.6\"></a>\n* I used the daily_activity and daily_calories tables to analyze if more steps would lead to more calories burned.\n* Similar to the last comparison, I used a temporary table and INNER JOIN to compare and contrast the sum of users total steps with the sum of their total calories burned.\n* Overall, there looks to be a positive correlation between amount of steps and calories burned. \n* There are some outliers, but I think the visualization will show clearly the positive correlation. More on that to come.\n* So in our users, the more steps they took the more calories they burned.","metadata":{}},{"cell_type":"code","source":"WITH temp_table AS (\nSELECT \n  Id,\n  SUM(TotalSteps) AS Sum_TotalSteps\nFROM\n  `my-data-project-12345-391023.fitbit_data.daily_activity`\nGROUP BY\n  Id\nORDER BY\n  Sum_TotalSteps DESC\n)\nSELECT \n  temp_table.Id,\n  temp_table.Sum_TotalSteps,\n  SUM(Calories) AS Sum_Calories\nFROM\n  temp_table\nINNER JOIN\n  `my-data-project-12345-391023.fitbit_data.daily_calories` AS daily_calories\nON\n  daily_calories.Id = temp_table.Id\nGROUP BY\n  temp_table.Id,\n  temp_table.Sum_TotalSteps\nORDER BY\n  temp_table.Sum_TotalSteps DESC","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![totalsteps_x_totalcalories.png](attachment:f514c68d-ba9c-420f-a24d-76b4c7de9105.png)\n\n* This could be an opportunity to create a Goals section within the app. \n* By aggregating and calculating the total steps and calories burned data we have from our users, we could recommend an estimated amount of steps needed to reach their calories burned goal. \n* I did a preliminary calculation of this using FitBit's data as an example. I used a temporary table to calculate the sum of the total steps taken and total calories burned by the users. Then I divided the two and rounded to two decimal places to get the amount of steps needed to burn one calorie amongst FitBit users. \n* The FitBit user's data shows it takes about 3.32 steps to burn one calorie. ","metadata":{},"attachments":{"f514c68d-ba9c-420f-a24d-76b4c7de9105.png":{"image/png":""}}},{"cell_type":"code","source":"WITH temp_table AS (\nSELECT \n  SUM(TotalSteps) AS Sum_TotalSteps,\n  SUM(Calories) AS Sum_Calories,\nFROM\n  `my-data-project-12345-391023.fitbit_data.daily_activity`\n)\nSELECT \n  ROUND(Sum_TotalSteps / Sum_Calories, 2) AS Steps_Per_Calorie\nFROM\n  temp_table","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![steps_per_calorie.png](attachment:5cea2eac-44d0-402c-96a0-dfbf1940d9ce.png)","metadata":{},"attachments":{"5cea2eac-44d0-402c-96a0-dfbf1940d9ce.png":{"image/png":""}}},{"cell_type":"markdown","source":"# 5. Share: <a class=\"anchor\"  id=\"5.0\"></a>\n\n### 5.1 Times Users Are Most Active Visualization <a class=\"anchor\"  id=\"5.1\"></a>\n* I created the visualization below in Tableau.\n* The most active times for users are 12pm-2pm and 5pm-7pm. \n* The Bellabeat app can send push notifications during these times to remind their users that it's time to workout.\n* I think there's also an opportunity to help change some of Bellabeat's users habits. The morning activity numbers are pretty low and there are a few extra benefits from working out in the morning.\n* According to [TIME magazine](https://time.com/5533388/best-time-to-exercise/), research shows you burn more stored fat working out in the morning. So if a user is more focused on weight-loss, Bellabeat can recommend working out in the morning.\n* [Forbes magazine](https://www.forbes.com/health/fitness/when-is-the-best-time-to-exercise/) adds that research shows working out in the morning can curb your appetite throughout the day as well. This can also be important for those users wanting to focus on weight-loss.\n* Both articles note that cortisol levels are highest in the morning and that cortisol plays in important role in habit formation. So working out in the morning can actually become a stronger habit than working out later in the day. \n* Both articles also notated increased concentration and productivity throughout the day for those working out in the morning. \n* Bellabeat could deliver beneficial information like this to their users along with suggestions to try and shift their workouts to the morning. \n* If a user wants to try changing to a morning workout, Bellabeat can then use push notifications before bed and in the morning to motivate their users to get active earlier.","metadata":{}},{"cell_type":"markdown","source":"<div class='tableauPlaceholder' id='viz1697205254439' style='position: relative'><noscript><a href='#'><img alt='Times Users Are Most Active ' src='https:&#47;&#47;public.tableau.com&#47;static&#47;images&#47;Be&#47;BellabeatCaseStudy_16969767616460&#47;TimeUsersAreMostActive&#47;1_rss.png' style='border: none' /></a></noscript><object class='tableauViz'  style='display:none;'><param name='host_url' value='https%3A%2F%2Fpublic.tableau.com%2F' /> <param name='embed_code_version' value='3' /> <param name='site_root' value='' /><param name='name' value='BellabeatCaseStudy_16969767616460&#47;TimeUsersAreMostActive' /><param name='tabs' value='no' /><param name='toolbar' value='yes' /><param name='static_image' value='https:&#47;&#47;public.tableau.com&#47;static&#47;images&#47;Be&#47;BellabeatCaseStudy_16969767616460&#47;TimeUsersAreMostActive&#47;1.png' /> <param name='animate_transition' value='yes' /><param name='display_static_image' value='yes' /><param name='display_spinner' value='yes' /><param name='display_overlay' value='yes' /><param name='display_count' value='yes' /><param name='language' value='en-US' /></object></div>                <script type='text/javascript'>                    var divElement = document.getElementById('viz1697205254439');                    var vizElement = divElement.getElementsByTagName('object')[0];                    vizElement.style.width='100%';vizElement.style.height=(divElement.offsetWidth*0.75)+'px';                    var scriptElement = document.createElement('script');                    scriptElement.src = 'https://public.tableau.com/javascripts/api/viz_v1.js';                    vizElement.parentNode.insertBefore(scriptElement, vizElement);                </script>","metadata":{}},{"cell_type":"markdown","source":"### 5.2 Days Users Are Most Active Visualization <a class=\"anchor\"  id=\"5.2\"></a>\n* I created the visualization below in Tableau.\n* Saturday has the highest average daily steps. However, Tuesday, Wednesday and Thursday all have higher total step counts. \n* This tells me that Tuesday-Thursday are the most active days, but users tend to walk longer distances on Saturdays when they do walk. \n* While certain times in the day may be better to workout during than others, one thing all of the articles I read agreed upon was that consistency is key when it comes to health and fitness.\n* I would suggest Bellabeat target users less active days to send reminders and inspiration to workout. Sending information reminding users of the benefits of consistency might help smooth out some of the inconsistencies in activity throughout the week. \n* Furthermore, the [CDC recommends](https://www.cdc.gov/media/releases/2020/p0324-daily-step-count.html) at least 8,000 steps per day. They found that getting 8,000 steps daily, as compared to 4,000 steps, can reduce a person's all-cause mortality rate by 51%. And 12,000 steps daily lowers a person's risk by 65% compared to 4,000 steps. \n* Using this tremendously valuable information, Bellabeat can also send encouraging messages to their users to meet these daily goals of 8,000-12,000 steps. This will keep users motivated and reminded to keep active throughout the day so they can reach their goals.","metadata":{}},{"cell_type":"markdown","source":"<div class='tableauPlaceholder' id='viz1697203590900' style='position: relative'><noscript><a href='#'><img alt='Days Users Are Most Active ' src='https:&#47;&#47;public.tableau.com&#47;static&#47;images&#47;Be&#47;BellabeatCaseStudyGraph2&#47;DaysUsersAreMostActive&#47;1_rss.png' style='border: none' /></a></noscript><object class='tableauViz'  style='display:none;'><param name='host_url' value='https%3A%2F%2Fpublic.tableau.com%2F' /> <param name='embed_code_version' value='3' /> <param name='site_root' value='' /><param name='name' value='BellabeatCaseStudyGraph2&#47;DaysUsersAreMostActive' /><param name='tabs' value='no' /><param name='toolbar' value='yes' /><param name='static_image' value='https:&#47;&#47;public.tableau.com&#47;static&#47;images&#47;Be&#47;BellabeatCaseStudyGraph2&#47;DaysUsersAreMostActive&#47;1.png' /> <param name='animate_transition' value='yes' /><param name='display_static_image' value='yes' /><param name='display_spinner' value='yes' /><param name='display_overlay' value='yes' /><param name='display_count' value='yes' /><param name='language' value='en-US' /></object></div>                <script type='text/javascript'>                    var divElement = document.getElementById('viz1697203590900');                    var vizElement = divElement.getElementsByTagName('object')[0];                    vizElement.style.width='100%';vizElement.style.height=(divElement.offsetWidth*0.75)+'px';                    var scriptElement = document.createElement('script');                    scriptElement.src = 'https://public.tableau.com/javascripts/api/viz_v1.js';                    vizElement.parentNode.insertBefore(scriptElement, vizElement);                </script>","metadata":{}},{"cell_type":"markdown","source":"### 5.3 Total Steps vs Total Minutes Asleep Visualization <a class=\"anchor\"  id=\"5.3\"></a>\n* I used R to create the visualization below.\n* First, I had to import my dataset(totalsteps_x_totalminutesasleep).","metadata":{}},{"cell_type":"code","source":"read.csv(\"totalsteps_x_totalminutesasleep.csv\")","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"* Then, using the code below, I plotted total steps compared to total minutes asleep.\n* As we thought from our earlier analysis in SQL, this plot also shows no correlation. \n* At this point, we can safely conclude that the daily activity level based on total steps and minutes users sleep a day are not related. ","metadata":{}},{"cell_type":"code","source":"ggplot(totalsteps_x_totalminutesasleep, aes(x=Sum_TotalMinutesAsleep, y=Sum_TotalSteps))+\n    geom_jitter() +\n    geom_smooth(color = \"red\") + \n    labs(title = \"Total Steps vs Total Minutes Asleep\", x = \"Total Steps\", y= \"Minutes Asleep\") +\n     theme(panel.background = element_blank(),\n      plot.title = element_text( size=16))","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![totalsteps_vs_totalminutesasleep_Rplot.png](attachment:d3f4be6b-91dc-42f2-8d10-879fb5bb1981.png)","metadata":{},"attachments":{"d3f4be6b-91dc-42f2-8d10-879fb5bb1981.png":{"image/png":""}}},{"cell_type":"markdown","source":"### 5.4 Total Sedentary Minutes vs Total Minutes Asleep Visualization <a class=\"anchor\"  id=\"5.4\"></a>\n* I created the visualization below in R.\n* First, I imported my dataset(totalsedentaryminutes_x_totalminutes asleep). ","metadata":{}},{"cell_type":"code","source":"read_csv(\"totalsedentaryminutes_x_totalminutesasleep\")","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"* Then, using the code below, I plotted total sedentary minutes compared to total minutes asleep. \n* As we thought from our earlier analysis in SQL, this plot shows a negative correlation between these two factors. \n* The data clearly shows that the less sedentary time a person experiences throughout their day the more sleep they will gain at night.\n* This is another great opportunity for helpful reminders and motivation from the Bellabeat app throughout the day. \n* If a person is focused on getting more sleep, then the app can focus more on total active minutes rather than total steps taken. \n* Bellabeat can arm their users with the knowledge that the less time they are inactive during the day the more time they will sleep at night.","metadata":{}},{"cell_type":"code","source":"ggplot(data=totalsedentaryminutes_x_totalminutesasleep, aes(x=Sum_TotalMinutesAsleep, y=Sum_SedentaryMinutes)) + \ngeom_point() + \ngeom_smooth() + \nlabs(title=\"Total Sedentary Minutes vs. Total Minutes Asleep\", x = \"Total Minutes Asleep\", y = \"Total Sedentary Minutes\")","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![totalsedentaryminutes_x_totalminutesasleep_Rplot.png](attachment:27697da8-cef4-414a-a3ba-8591757db0a3.png)","metadata":{},"attachments":{"27697da8-cef4-414a-a3ba-8591757db0a3.png":{"image/png":""}}},{"cell_type":"markdown","source":"### 5.5 Total Time In Bed vs Total Minutes Asleep Visualization <a class=\"anchor\"  id=\"5.5\"></a>\n* I used R to create the visualization below as well. \n* First, I imported my dataset(totalminutesasleep_x_totaltimeinbed).","metadata":{}},{"cell_type":"code","source":"read_csv(\"totalminutesasleep_x_totaltimeinbed\")","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"* Then, using the code below, I plotted the total time in bed compared to the total minutes asleep.\n* Just as I found during my analysis in SQL, there is a positive correlation between a users' total time in bed and their total minutes asleep.\n* This seems pretty obvious, but I think a lot of people take this for granted. If you want to get more sleep, get into bed earlier.\n* This presents another great opportunity for Bellabeat. The [CDC recommends](https://www.cdc.gov/sleep/about_sleep/how_much_sleep.html) at least 7 hours of sleep for adults. Based on the time users want to get up every day, we can send notification reminders for when to go to bed in order to get the recommended amount. ","metadata":{}},{"cell_type":"code","source":"ggplot(data=totalminutesasleep_x_totaltimeinbed, aes(x=Sum_TotalMinutesAsleep, y=Sum_TotalTimeInBed)) + \ngeom_point() + \ngeom_smooth() + \nlabs(title=\"Total Time In Bed vs. Total Minutes Asleep\", x = \"Total Minutes Asleep\", y = \"Total Sedentary Minutes\")","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"![totaltimeinbed_x_totalminutesasleep.png](attachment:141ab4e6-1649-4c40-ade7-6dfc5f77cf53.png)","metadata":{},"attachments":{"141ab4e6-1649-4c40-ade7-6dfc5f77cf53.png":{"image/png":""}}},{"cell_type":"markdown","source":"### 5.6 Total Steps vs Calories Burned Visualization <a class=\"anchor\"  id=\"5.6\"></a>\n* I created the visualization below in Tableau.\n* There is a positive correlation between the amount of steps a user takes and the amount of calories they burn. \n* This is a great opportunity for a Goals section of the app. \n* Based on how many calories a user wants to burn in a day, Bellabeat can set a goal for the amount of steps it will take them to achieve this goal. \n* Using the FitBit users' data, I was able to calculate that it takes 3.32 steps to burn one calorie. However, this is a calculation based on an aggregated population's data.\n* Bellabeat could use the data they're collecting on each individual to customize a plan for each user. \n* Bellabeat can calculate precisely how many steps each individual needs to take to burn a calorie. \n* So when a user enters a goal for the amount of calories they want to burn in a given day, Bellabeat can let them know exactly how many steps they personally need to take in order to meet their goal. ","metadata":{}},{"cell_type":"markdown","source":"<div class='tableauPlaceholder' id='viz1697203458534' style='position: relative'><noscript><a href='#'><img alt='Total Steps vs Total Calories Burned ' src='https:&#47;&#47;public.tableau.com&#47;static&#47;images&#47;Be&#47;BellabeatCaseStudyGraph3&#47;TotalStepsvsTotalCaloriesBurned&#47;1_rss.png' style='border: none' /></a></noscript><object class='tableauViz'  style='display:none;'><param name='host_url' value='https%3A%2F%2Fpublic.tableau.com%2F' /> <param name='embed_code_version' value='3' /> <param name='site_root' value='' /><param name='name' value='BellabeatCaseStudyGraph3&#47;TotalStepsvsTotalCaloriesBurned' /><param name='tabs' value='no' /><param name='toolbar' value='yes' /><param name='static_image' value='https:&#47;&#47;public.tableau.com&#47;static&#47;images&#47;Be&#47;BellabeatCaseStudyGraph3&#47;TotalStepsvsTotalCaloriesBurned&#47;1.png' /> <param name='animate_transition' value='yes' /><param name='display_static_image' value='yes' /><param name='display_spinner' value='yes' /><param name='display_overlay' value='yes' /><param name='display_count' value='yes' /><param name='language' value='en-US' /></object></div>                <script type='text/javascript'>                    var divElement = document.getElementById('viz1697203458534');                    var vizElement = divElement.getElementsByTagName('object')[0];                    vizElement.style.width='100%';vizElement.style.height=(divElement.offsetWidth*0.75)+'px';                    var scriptElement = document.createElement('script');                    scriptElement.src = 'https://public.tableau.com/javascripts/api/viz_v1.js';                    vizElement.parentNode.insertBefore(scriptElement, vizElement);                </script>","metadata":{}},{"cell_type":"markdown","source":"# 6. Act: <a class=\"anchor\"  id=\"6.0\"></a>\n### 6.1 Conclusion <a class=\"anchor\"  id=\"6.1\"></a>\nBellabeat empowers and inspires women through knowledge about their own health and habits. The Bellabeat app is at the core of this power. It arms users with information on their activity, sleep, stress, menstrual cycle and mindfullness habits. It's an all-encompassing tool that connects to Bellabeat's full line of wearable/usable smart wellness products. \n\nTo effectively address our business objectives and support Bellabeat in their mission, I recommend leveraging Bellabeat's proprietary tracking data for a more in-depth analysis. The datasets utilized in this analysis possess a limited sample size and potential biases, as we lack demographic information about users. Given that our primary audience comprises young adult women, I suggest persisting in the pursuit of trends to craft a targeted marketing strategy tailored to this demographic.\n\nHowever, through my analysis I still gained interesting insights that I think will inform marketing strategies moving forward and help improve the Bellabeat app as a whole. \n\n### 6.2 Next Steps - Recommendations <a class=\"anchor\"  id=\"6.2\"></a>\n1. **Morning Workout Track:** Research shows that people burn more stored fat when working out in the morning and a morning workout helps curb a person's appetite throughtout the day. Also, cortisol levels are highest in the morning. Cortisol is directly linked to habit-formation. Furthermore, research shows increased productivity and concentration throughout the day for those who work out in the morning. Bellabeat should deliver beneficial information like this to their users along with suggestions to try and shift their workouts to the morning. If a user wants to try changing to a morning workout, Bellabeat can then use push notifications before bed and in the morning to motivate their users to get active earlier.\n\n2. **Target Less Active Days:** While specific times of the day may offer slightly better conditions for a workout, all the articles I consulted unanimously emphasized that maintaining consistency is paramount for achieving health and fitness goals. Bellabeat should target users' less active days to send reminders and inspiration to workout. Through my analysis the least active days to target are Sunday, Monday and Friday. Sending information reminding users of the benefits of working out consistently might help smooth out some of the inconsistencies in their activity throughout the week.\n\n3. **Daily Step Goal:** The CDC suggests a minimum of 8,000 daily steps. Their research indicates that achieving 8,000 steps, as opposed to 4,000, can decrease an individual's overall mortality risk by 51%. Moreover, taking 12,000 steps daily reduces the risk by 65% compared to 4,000 steps. During my analysis, I found that on average users are only reaching the minimum goal of 8,000 steps on Tuesday's and Saturday's. Leveraging this invaluable insight, Bellabeat can proactively send uplifting messages to their users, encouraging them to meet the daily targets of 8,000-12,000 steps. This strategy will help maintain user motivation and serve as a reminder to stay active throughout the day, enabling them to reach their desired fitness goals.\n\n4. **An Active Day = A Restful Night:** Based on my analysis, it's evident that reducing sedentary time during the day leads to increased sleep. This presents a valuable opportunity for Bellabeat's app to provide timely reminders and motivation. For individuals prioritizing improved sleep, the app can emphasize total active minutes throughout a user's day over step count. By imparting this insight, Bellabeat empowers users to understand that minimizing inactivity during the day results in a more restful sleep at night.\n\n5. **Bedtime Reminders:** After examining the data, it's clear that there's a direct relationship between the total time a user spends in bed and the actual minutes they spend asleep. While this might seem intuitive, it's a fundamental aspect that many may overlook. Simply put, if you aim for more sleep, an earlier bedtime is key. This insight offers Bellabeat yet another promising avenue. Following CDC guidelines of a minimum of 7 hours of sleep for adults, we can provide timely notifications to users, indicating when they should head to bed in order to achieve the recommended duration of sleep based on their desired wake-up time.\n\n6. **Calories Burned Goal:** Upon analyzing the data, it's evident that there exists a positive correlation between a user's step count and the calories they expend. This presents a prime opportunity for a Bellabeat app section dedicated to setting and tracking fitness goals. By specifying the daily calorie-burning objective, Bellabeat can establish a corresponding step target for users. Using FitBit data, I determined it takes an average of 3.32 steps to burn 1 calorie. However, this calculation is based on aggregated data from a broad population. Bellabeat has the potential to leverage individualized user data to create tailored plans. By precisely calculating the steps required for each user to burn a calorie, Bellabeat can provide personalized guidance to their customers. Thus, when a user sets a calorie-burning goal for the day, the app can inform them of the exact number of steps they personally need to take to accomplish their objective.","metadata":{}},{"cell_type":"markdown","source":"### 6.3 Appendix <a class=\"anchor\"  id=\"6.3\"></a>\n* FitBit Fitness Tracker Data - https://www.kaggle.com/datasets/arashnic/fitbit  \n* How Much Sleep Do I Need? - https://www.cdc.gov/sleep/about_sleep/how_much_sleep.html  \n* Higher Daily Step Count Linked with Lower All-cause Mortality - https://www.cdc.gov/media/releases/2020/p0324-daily-step-count.html  \n* This Is the Best Time of Day to Work Out, According to Science - https://time.com/5533388/best-time-to-exercise/  \n* When Is The Best Time To Exercise? - https://www.forbes.com/health/fitness/when-is-the-best-time-to-exercise/  ","metadata":{}},{"cell_type":"markdown","source":"![](https://play-lh.googleusercontent.com/1DEgw7f-f8Dtp7r0lZ3qn7FfsNb_zYGWVkrAdf5ht8eDFEnRi1HX5Qk-NRTJ9cwbzUg=s180)","metadata":{}}]}